import React from "react";

const CompanyShowcase = () => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Company Showcase</h1>
      <p>We will show company logos and names here from the backend.</p>
    </div>
  );
};

export default CompanyShowcase;
